import React, { useState } from 'react';
import { TextField, Button, Dialog, DialogActions, DialogContent, DialogTitle, Typography, Box } from '@mui/material';

const PasswordForm = ({ open, onPasswordSubmit }) => {
    const [password, setPassword] = useState('');
    const [error, setError] = useState('');

    const handlePasswordSubmit = () => {
        if (password === 'correct_password') { // Replace 'correct_password' with your actual password
            onPasswordSubmit();
        } else {
            setError('Incorrect password. Please try again.');
        }
    };

    return (
        <Dialog open={open} disableBackdropClick disableEscapeKeyDown>
            <DialogTitle>
                <Typography variant="h6" component="div">
                    Secure Access
                </Typography>
            </DialogTitle>
            <DialogContent>
                <Typography variant="body1" component="p" gutterBottom>
                    Please enter the password to access the 7DT Target of Opportunity (ToO) Request.
                </Typography>
                <Box component="form" noValidate autoComplete="off">
                    <TextField
                        autoFocus
                        margin="dense"
                        label="Password"
                        type="password"
                        fullWidth
                        value={password}
                        onChange={(e) => setPassword(e.target.value)}
                        error={!!error}
                        helperText={error}
                        variant="outlined"
                    />
                </Box>
            </DialogContent>
            <DialogActions>
                <Button onClick={handlePasswordSubmit} color="primary" variant="contained">
                    Submit
                </Button>
            </DialogActions>
        </Dialog>
    );
};

export default PasswordForm;
